window.bookSummaryJSON = "<p><b>Matt, Liz, and Aster are now Tier 10. </b></p> <p>That means it's time for the Pather tournament. There they will face people who are as strong as them for the first time.</p> <p>But things are never easy.</p> <p>With years of Luna's guidance they will have to compete twice. Once as themselves and again under a mask with restrictions meant to ensure they really are the strongest.</p> <p><b>Don't miss Book 5 of this action-packed fantasy adventure that blends everything you love about LitRPG with Xianxia. </b></p> <p><b>About the series:</b> <i>This is a mix between LitRPG and Xianxia. It's like a car that looks like a LitRPG with dungeons and skills, but the interior and engine are all Xianxia. It features a magic system and progression system that are logically and internally consistent, as well as realistic fight scenes and a rational MC.</i></p>"; 
